function Tasks() {
const [tasks, setTasks] = React.useState([]);

  useEffect(() => 
  {
    fetch("/fecthtasks").then((response) =>
      response.json().then((data) => {
        setTasks(data);
      })
    );
  }, []);
  return <div>Tasks</div>;
}

export default Tasks;
